import React from "react";

const Main = () => {
    return (
        <div>
            <h1>Strona z pozytywnymi memami</h1>
            <p>Witamy na stronie ze śmiesznymi obrazkami, które spróbują nastawić Cię pozytywnie do życia.</p>
            <p>Zapraszam do zapoznania się z plikiem
            <Link to="/files/README.md" target="_blank" title="Otworzy się w nowym oknie." download>README.md</Link>
            </p>
        </div>
    );
};

export default Main;
